import questions from '../data/questions';

function Determine({id, setId}){
	function neeHandler(){
		console.log("neeHandler")
		setId(questions[id][1]);
	}
	function jaHandler(){
		console.log("jaHandler")
		setId(questions[id][0]);
	}
	return (
		<div className="determine">
				{questions[id][2]}	
				<br/><br/>			
				<div className="btn-group">
					<button className="fa" onClick={jaHandler}> JA </button>
					<button className="fa NW"> WEET IK NIET </button>
					<button className="fa" onClick={neeHandler}>NEE </button>
				</div>

		</div>
	);
}

export default Determine;
